import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M8 14A6 6 0 108 2a6 6 0 000 12zM5.47 6a1.56 1.56 0 012.3 0l.23.25.22-.24.16-.15a1.56 1.56 0 012.14.16 1.8 1.8 0 010 2.43L8.2 10.92c-.1.1-.26.1-.36 0L5.48 8.43a1.8 1.8 0 010-2.43z", fill: primaryFill }));
};
const HeartCircle16Filled = wrapIcon(rawSvg({}), 'HeartCircle16Filled');
export default HeartCircle16Filled;
